import React, { useEffect } from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls, useGLTF } from '@react-three/drei';
import './App.css';

function DigitalHuman() {
  const { scene, materials, isLoading, error } = useGLTF('/models/girl.glb');

  useEffect(() => {
    if (error) {
      console.error('Error loading model:', error);
    }
    if (isLoading) {
      console.log('Loading model...');
    }
    if (scene) {
      console.log('Model loaded:', scene);
      scene.traverse((child) => {
        if (child.isMesh) {
          console.log('Mesh:', child);
          console.log('Material:', child.material);
          if (child.material) {
            console.log('Material properties:', {
              name: child.material.name,
              color: child.material.color,
              map: child.material.map,
              emissive: child.material.emissive,
              emissiveMap: child.material.emissiveMap,
              roughness: child.material.roughness,
              metalness: child.material.metalness,
            });
          }
        }
      });
    }
  }, [scene, materials, isLoading, error]);

  if (error) {
    return <p>Error loading model.</p>;
  }
  if (isLoading) {
    return <p>Loading model...</p>;
  }
  return <primitive object={scene} scale={0.5} position={[0, -1.5, 0]} />;
}

function App() {
  return (
    <div className="App">
      <Canvas>
        <ambientLight intensity={1} />
        <directionalLight position={[0, 5, 5]} />
        <DigitalHuman />
        <OrbitControls />
      </Canvas>
    </div>
  );
}

export default App;
